import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  flex:1;
  background-color: #202020;
  height:100vh;
`;

//   height:5vh mane holo ei component total jottuk space pae tar 5% nibe.. ekhane 00vh mane puratai nibe


const Menu = () => {
  return (
    <Container>
      Menu Items
    </Container>
  )
}

export default Menu
